import React from 'react';

const Table = ({ customers, loading }) => {
  if (loading) {
    return <div>Loading...</div>;
  }

  return (
    <table>
      <thead>
        <tr>
          <th>S.No</th>
          <th>Customer Name</th>
          <th>Age</th>
          <th>Phone</th>
          <th>Location</th>
          <th>Date</th>
          <th>Time</th>
        </tr>
      </thead>
      <tbody>
        {customers.map((customer, index) => (
          <tr key={customer.sno}>
            <td>{index + 1}</td>
            <td>{customer.customer_name}</td>
            <td>{customer.age}</td>
            <td>{customer.phone}</td>
            <td>{customer.location}</td>
            <td>{customer.created_at.split('T')[0]}</td>
            <td>{customer.created_at.split()}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Table;
